import "./topbar.css";

const Topobar = () => {
  return (
    <div className="top">
      <div className="topLeft">
        <i class="fab fa-facebook-square"></i>
      </div>
      <div className="topCenter">C</div>
      <div className="topRight">R</div>
    </div>
  );
};

export default Topobar;
